import React, { Fragment } from "react";

function Registration(){
    return(
    <Fragment>
        <div>Registration</div>
        <label>Name</label>
        <input type="text" id="txtName" placeholder="Enter Name"/><br></br>
        <label>Surname</label>
        <input type="text" id="txtSurname" placeholder="Enter Surname"/><br></br>
        <label>Email</label>
        <input type="text" id="txtEmail" placeholder="Enter Email"/><br></br>
        <label>Password</label>
        <input type="text" id="txtPassword" placeholder="Enter Password"/><br></br>
        <button>Save</button>
    </Fragment>
    
    )
}
export default Registration;
